Selon le vocabulaire de la comptabilité nationale, l’investissement (mesuré par la formation brute de capital fixe, en abrégé FBCF), peut être le fait de différents agents économiques : 
* pour les entreprises : c'est la valeur des biens durables acquis pour être utilisés pendant au moins un an dans leur processus de production. Il peut avoir trois formes : capacité, remplacement et productivité ; 
* pour les ménages : la FBCF dans le cadre de leur activité domestique ne concerne que l'acquisition ou la production pour leur propre compte de logements ; 
* pour les entrepreneurs individuels : la formation brute de capital fixe (FBCF) des ménages en tant qu'entrepreneurs est comptée dans la FBCF des entreprises. Les investissements financiers, les acquisitions de terrains et les investissements immatériels (publicité, etc.) ne sont pas comptabilisés dans la FBCF, bien que ces investissements aient pris depuis les années 1980 une grande importance dans la stratégies des sociétés. Le rendement d'un investissement fait l'objet d'un calcul prenant en compte sa durée de vie ou sa durée d'utilisation (avec dans ce cas la prise en compte de valeur finale résiduelle de l'investissement). L'investissement durable stratégique désigne un type d'investissement se voulant plus vertueux, dans la perspective de développement durable, ce qui implique de prendre en compte dans la prise de décision d'investissement de nouveaux paramètres comme la durabilité et la soutenabilité.
